import { Component } from 'react';
import '../styles//mediaCard.css';

function Media(props) {
    // console.log(props.data[0].links[0].href)

    return (
        <div className="Media">
            {props.data.length != 0  ? 
            <div>

                <br/>
            <div className="img"><img width="520" height="315" src={props.data[0].links[0].href}></img></div> 
            <div className="title">{props.data[0].data[0].title}</div>
            </div>
            : null}

        </div>
    )
}

export default Media;
